### 思路
可以通过vector容器实现栈的基本功能，除``increment``方法外，时间复杂度均为``O(1)``，increment方法因为遍历栈，所以时间复杂度为``O(lim)``
通过一额外数组存储栈中每一元素的加值，并在pop时将元素加上其加值，一同返回，可避免遍历
### 代码
```c++
class CustomStack {
public:
    vector<int> stk;
    vector<int> add;
    int top;

    CustomStack(int maxSize) {
        stk.resize(maxSize);
        add.resize(maxSize);
        top = -1;
    }

    void push(int x) {
        if(top != stk.size() - 1) {
            ++top;
            stk[top] = x;
        }
    }

    int pop() {
        if(top == -1)
            return -1; 
        int ret = stk[top] + add[top];
        if(top != 0)
            add[top - 1] += add[top];
        add[top] = 0;
        --top;
        return ret;
    }

    void increment(int k, int val) {
        int lim = min(k - 1, top);
        if(lim >= 0)
            add[lim] += val;
    }
};
```

