### 思路
使用last记录上次遇到c的位置，从左向右遍历字符串，只需在每次遇到c时更新last~当前c之间的元素的距离
注意遇到第一个c之前的所有最短距离只能是第一个c的index减去i
注意只有在遇到c时才会更新上一个区间，故可能会有最后一个c之后到最后一个字符这个区间没有被更新，需要处理

### 代码


```java
    class Solution {
        public int[] shortestToChar(String s, char c) {
            int last = -1;
            int n = s.length();
            int[] ans = new int[n];
            for (int i = 0; i < n; i++) {
                if (s.charAt(i) == c) {
                    int j = last + 1;
                    while (j <= i) {
                        if (last == -1) {
                            ans[j] = i - j;
                        } else {
                            ans[j] = Math.min(i - j, j - last);
                        }
                        j++;
                    }
                    last = i;
                }
            }
            if (last != n - 1) {
                for (int j = last + 1; j < n; j++) {
                    ans[j] = j - last;
                }
            }
            return ans;
        }
    }
}


```

