## 思路

### 1. “暴力解法”

作为一个算法小白，会自然而然带入平时对写业务的理解来实现，即：
- 求 num 数组实际数字总和，`[1,2,0,0]` => `1200`
- 总和加 `k`, `1200 + k`
- 转为字符串遍历，在放到新的数组中

> 但学算法应该从数据结构的特性出发

### 2. 倒序-逐个相加-进位

通过倒序遍历数组，从个位开始相加 `k`，并记录进位
-  `k` 加当前位大于 9 时，保留个位
- 处理进位，减去个位除以10（十进制）
- 处理最后位，即最终剩余进位 加`num[0]` 大于9，需要再次向前进位的情况

### 代码
```js
var addToArrayForm = function (num, k) {
  let carry = k;
  let res = [];

  for (let idx = num.length - 1; idx >= 0; idx--) {
    let cur = num[idx];
    // 向 res 数组中 push 相加后所得的个位数
    res.push((cur + carry) % 10);
    // 处理进位，减去个位除以10
    carry = Math.floor((cur + carry) / 10);
  }

  while (carry > 0) {
    res.push(carry % 10);
    carry = Math.floor(carry / 10);
  }

  return res.reverse();
};

```

### 复杂度分析

- 时间复杂度：`O(n + log(k-n))`,
- 时间复杂度：`O(n + (k - n))`

> 对于时间复杂度：遍历 `num`需要 `O(n)` 时间 ，处理多余进位的情况为`O(log(k-n))`

> 对于空间复杂度：新开了一个数组，其长度是 `n + (k - n)`, `k - n` 是最后处理剩余进位的情况

## 题目
[1381. 设计一个支持增量操作的栈](https://leetcode.cn/problems/design-a-stack-with-increment-operation/description/)

## 思路
当进行`increment`操作时，让所有元素一次出栈进入另一个临时栈，然后再依次入栈并执行相加操作


## 代码
```js
/**
 * @param {number} maxSize
 */
var CustomStack = function (maxSize) {
  this.maxSize = maxSize;
  this.stack = [];
  this.topPos = 0;
};

/**
 * @param {number} x
 * @return {void}
 */
CustomStack.prototype.push = function (x) {
  // 说明已经在栈顶的位置了，不能继续push
  if (this.topPos >= this.maxSize) return;
  this.topPos += 1;
  this.stack.push(x);
};

/**
 * @return {number}
 */
CustomStack.prototype.pop = function () {
  if (this.topPos == 0) return -1;
  this.topPos -= 1;
  return this.stack.pop();
};

/**
 * @param {number} k
 * @param {number} val
 * @return {void}
 */
CustomStack.prototype.increment = function (k, val) {
  const tempStack = [];
  const len = this.topPos;

  while (this.topPos) {
    tempStack.push(this.pop());
  }
  for (let i = 1; i <= len; i++) {
    let ele = tempStack.pop();
    if (i <= k) ele += val;
    this.push(ele);
  }
};

```

## 复杂度分析

- 时间复杂度：`O(2n)`,
> 需要进行两次遍历出入栈操作

- 空间复杂度：`O(2maxSize)`
> 需要多维护一个临时栈

