private List<Integer> way1(int[] num, int k) {
    // 前面填充 0，是 num 长度和 kString 的长度一致
    int maxLength = Math.max(String.valueOf(k).length(), num.length);
    if (num.length != maxLength) {
        num = padZero(maxLength, num);
    }

    List<Integer> result = new ArrayList<>(maxLength);

    // 需要向上进位的数
    int carryNum = 0;
    for (int i = num.length - 1; i >= 0; i--) {
        // 当前位数计算需要加的值
        int addNum = num[i] + k % 10;
        k = k / 10;

        if (carryNum != 0) {
            addNum = addNum + carryNum % 10;
            carryNum = carryNum / 10;
        }
        if (addNum > 9) {
            result.add(0, addNum % 10);
            carryNum = carryNum + (addNum / 10);
        } else {
            result.add(0, addNum);
        }
    }

    // 处理没有处理完的需要进位的数
    if (carryNum != 0) {
        // 没有处理完的进位的位数
        int carryNumLength = String.valueOf(carryNum).length();
        for (int i = 0; i < carryNumLength; i++) {
            result.add(0, carryNum % 10);
            carryNum = carryNum / 10;
        }
    }

    return result;
}

private int[] padZero(int maxLength, int[] targetNum) {
    int[] num;
    int padLength = maxLength - targetNum.length;
    int[] newNum = new int[maxLength];
    for (int i = 0; i < maxLength; i++) {
        if (i < padLength) {
            newNum[i] = 0;
        } else {
            newNum[i] = targetNum[i - padLength];
        }
    }
    num = newNum;
    return num;
}
