                String msg = repeatCharStack.pollLast().toString();
                for (int integer = 0; integer < repeatCount; integer++) {
                    // 如果栈空，则直接加入答案
                    if (repeatCharStack.isEmpty()) {
                        result.append(msg);
                    }
                    // 如果栈不空，则需要添加到上个栈中
                    else {
                        repeatCharStack.peekLast().append(msg);
                    }
                }
            } else {
                // 说明是数字
                if (Character.isDigit(currentChar)) {
                    // 之前的值乘 10 再加上当前数字
                    continuousNumber = continuousNumber * 10 + Integer.parseInt(String.valueOf(currentChar));
                }
                // 说明是字母
                else {
                    // 如果符号栈为空，则直接加入结果
                    if (repeatCountStack.isEmpty()) {
                        result.append(currentChar);
                    }
                    // 说明当前处于 [] 之中，需要将当前内容添加入栈
                    else {
                        StringBuilder stringBuilder = repeatCharStack.getLast();
                        stringBuilder.append(currentChar);
                    }
                }
            }
        }

        return result.toString();
