### 解题思路

#### 思路
1、初始化的时候就创建maxSize的int数组，减少后续扩容的操作。
2、为了能够O(1)进行pop和push，那么需要记录下当前数据到哪个索引下标了，所以增加nextIndex表示下次操作索引，当pop和push时记录对其++或者--

##### 代码
