### 解题思路
1、要匹配[]，那么使用栈的方式，记录]入栈的时候再处理比较合适。
2、先把非]的字符压入栈，当字符为]时，开始处理栈里面的数据。
  2.1 首先获取]之前到[所有的字母。
  2.2 然后获取[之前所有的数字。
  2.3 然后根据数字，获取倍数的[]的字母
  2.4 再把得到的倍数字符串放入到栈中，继续处理，直到下次的]出现，再运行上面的流程。
3、最后获取栈里面所有的字母转换为字符串

#### 思路


##### 代码
