# 思路
将数组转为字符串，然后转为 int，直接相加，然后再转为字符串拆分保存


# 复杂度
- 时间复杂度:
> 添加时间复杂度, 示例： $O(n)$

- 空间复杂度:
> 添加空间复杂度, 示例： $O(n)$
  


# Code
```Java []

import java.math.BigInteger;
class Solution {
    public static List<Integer> addToArrayForm(int[] num, int k) {
        List<Integer> res = new ArrayList<Integer>();

        int nLength = num.length;
        StringBuffer numS = new StringBuffer();
        for (int i = 0; i < nLength; i++) {
            numS.append(String.valueOf(num[i]));
        }
        BigInteger numB = new BigInteger(numS.toString());
        BigInteger add = numB.add(BigInteger.valueOf(k));
        String resS = String.valueOf(add);
        char[] charArray = resS.toCharArray();

        for (char c : charArray) {
            res.add(Integer.valueOf(String.valueOf(c)));
        }

        return res;
    }
}
```

# 思路
问题可以转换成，对 s 的每个下标 i，求

s[i] 到其左侧最近的字符 c 的距离
s[i] 到其右侧最近的字符 c 的距离
这两者的最小值。

对于前者，我们可以从左往右遍历 s，若 s[i]=c 则记录下此时字符 c 的的下标 idx。遍历的同时更新 answer[i]=i−idx。

对于后者，我们可以从右往左遍历 s，若 s[i]=c 则记录下此时字符 c 的的下标 idx。遍历的同时更新 answer[i]=min⁡(answer[i],idx−i)。

代码实现时，在开始遍历的时候 idx 可能不存在，为了简化逻辑，可以用 −n 或 2n 表示，这里 n 是 s 的长度。

参考
作者：力扣官方题解
链接：https://leetcode.cn/problems/shortest-distance-to-a-character/solutions/1429810/zi-fu-de-zui-duan-ju-chi-by-leetcode-sol-2t49/
来源：力扣（LeetCode）


# 复杂度
- 时间复杂度:
> 添加时间复杂度, 示例： $O(n)$，n 为字符串长度

- 空间复杂度:
> 添加空间复杂度, 示例： $O(1)$
  


# Code
```Java []

class Solution {
    public int[] shortestToChar(String s, char c) {

        int n = s.length();
        int[] ans = new int[n];

        for (int i = 0, idx = -n ; i < n; i++) {
            if (s.charAt(i) == c) {
                idx = i;
            }
            ans[i] = i - idx;

        }

        for (int i = n -1, idx = 2 * n; i >= 0; i--){
            if (s.charAt(i) == c) {
                idx = i;
            }

            ans[i] = Math.min(ans[i], idx - i);
        }

        return ans;

    }
}
```

